import React from 'react';
import Navbar from './components/Navbar';
import Hero from './components/Hero';
import BandMembers from './components/BandMembers';
import Events from './components/Events';
import AboutUs from './components/AboutUs';
import Contact from './components/ContactUs';
import styles from './App.module.css';

function App() {
  return (
    <div className={styles.app}>
      <Navbar />
      <Hero id="home" />
      <section id="band" className={styles.bandSection}>
        <h2 className={styles.sectionHeader}>Meet the Band</h2>
        <BandMembers />
      </section>
      <section id="events" className={styles.eventsSection}>
        <h2 className={styles.sectionHeader}>Events</h2>
        <Events />
      </section>
      <section id="about" className={styles.aboutSection}>
        <h2 className={styles.sectionHeader}>About Us</h2>
        <AboutUs />
      </section>
      <section id="contact" className={styles.contactSection}>
        <h2 className={styles.sectionHeader}>Contact Us</h2>
        <Contact />
      </section>
    </div>
  );
}

export default App;
